import React, { useState, useEffect } from 'react';
import { itemsApi } from '../api';

function ItemRequests() {
  const [requests, setRequests] = useState([]);
  const [loading, setLoading] = useState(true);
  const [generating, setGenerating] = useState({});
  const [selectedItem, setSelectedItem] = useState(null);
  const [filter, setFilter] = useState('');
  const [message, setMessage] = useState(null);

  useEffect(() => {
    loadRequests();
  }, [filter]);

  const loadRequests = async () => {
    try {
      setLoading(true);
      const params = filter ? { status: filter } : {};
      const res = await itemsApi.getRequests(params);
      setRequests(res.data || []);
    } catch (error) {
      setMessage({ type: 'error', text: error.message });
    } finally {
      setLoading(false);
    }
  };

  const handleGenerate = async (requestId) => {
    try {
      setGenerating(prev => ({ ...prev, [requestId]: true }));
      const res = await itemsApi.generate(requestId);
      setMessage({ type: 'success', text: `Î¨∏Ìï≠ ÏÉùÏÑ± ÏôÑÎ£å: ${res.data.validationResult}` });
      loadRequests();
    } catch (error) {
      setMessage({ type: 'error', text: error.message });
    } finally {
      setGenerating(prev => ({ ...prev, [requestId]: false }));
    }
  };

  const handleGenerateAll = async () => {
    try {
      setMessage({ type: 'info', text: 'Ï†ÑÏ≤¥ PENDING Î¨∏Ìï≠ ÏÉùÏÑ± Ï§ë...' });
      const res = await itemsApi.generatePending();
      setMessage({ type: 'success', text: res.message });
      loadRequests();
    } catch (error) {
      setMessage({ type: 'error', text: error.message });
    }
  };

  const handleDelete = async (requestId) => {
    if (!window.confirm('Ïù¥ ÏöîÏ≤≠ÏùÑ ÏÇ≠Ï†úÌïòÏãúÍ≤†ÏäµÎãàÍπå?')) return;

    try {
      await itemsApi.deleteRequest(requestId);
      setMessage({ type: 'success', text: 'ÏöîÏ≤≠Ïù¥ ÏÇ≠Ï†úÎêòÏóàÏäµÎãàÎã§.' });
      loadRequests();
    } catch (error) {
      setMessage({ type: 'error', text: error.message });
    }
  };

  const handleViewDetail = async (requestId) => {
    try {
      const res = await itemsApi.getRequest(requestId);
      setSelectedItem(res.data);
    } catch (error) {
      setMessage({ type: 'error', text: error.message });
    }
  };

  const getStatusBadge = (status) => {
    const statusMap = {
      PENDING: { class: 'badge-pending', text: 'ÎåÄÍ∏∞ Ï§ë' },
      RUNNING: { class: 'badge-running', text: 'Ïã§Ìñâ Ï§ë' },
      OK: { class: 'badge-ok', text: 'ÏÑ±Í≥µ' },
      FAIL: { class: 'badge-fail', text: 'Ïã§Ìå®' }
    };
    const info = statusMap[status] || { class: 'badge-pending', text: status };
    return <span className={`badge ${info.class}`}>{info.text}</span>;
  };

  return (
    <div>
      <div className="flex-between mb-4">
        <h1>üìã Î¨∏Ìï≠ ÏöîÏ≤≠ Î™©Î°ù</h1>
        <div className="flex gap-2">
          <button className="btn btn-success" onClick={handleGenerateAll}>
            üöÄ Ï†ÑÏ≤¥ PENDING Ï≤òÎ¶¨
          </button>
          <a href="/items/create" className="btn btn-primary">‚ûï ÏÉà ÏöîÏ≤≠</a>
        </div>
      </div>

      {message && (
        <div className={`alert alert-${message.type}`}>
          {message.text}
          <button
            onClick={() => setMessage(null)}
            style={{ float: 'right', background: 'none', border: 'none', cursor: 'pointer' }}
          >
            ‚úï
          </button>
        </div>
      )}

      {/* ÌïÑÌÑ∞ */}
      <div className="card">
        <div className="flex gap-2">
          <button
            className={`btn ${filter === '' ? 'btn-primary' : 'btn-secondary'} btn-sm`}
            onClick={() => setFilter('')}
          >
            Ï†ÑÏ≤¥
          </button>
          <button
            className={`btn ${filter === 'PENDING' ? 'btn-primary' : 'btn-secondary'} btn-sm`}
            onClick={() => setFilter('PENDING')}
          >
            ÎåÄÍ∏∞ Ï§ë
          </button>
          <button
            className={`btn ${filter === 'OK' ? 'btn-primary' : 'btn-secondary'} btn-sm`}
            onClick={() => setFilter('OK')}
          >
            ÏÑ±Í≥µ
          </button>
          <button
            className={`btn ${filter === 'FAIL' ? 'btn-primary' : 'btn-secondary'} btn-sm`}
            onClick={() => setFilter('FAIL')}
          >
            Ïã§Ìå®
          </button>
        </div>
      </div>

      {/* ÏöîÏ≤≠ Î™©Î°ù */}
      <div className="card">
        {loading ? (
          <div className="loading">
            <div className="spinner"></div>
            <span>Î°úÎî© Ï§ë...</span>
          </div>
        ) : requests.length === 0 ? (
          <p className="text-muted text-center" style={{ padding: '40px' }}>
            ÏöîÏ≤≠Ïù¥ ÏóÜÏäµÎãàÎã§.
          </p>
        ) : (
          <div className="table-container">
            <table>
              <thead>
                <tr>
                  <th>ÏöîÏ≤≠ ID</th>
                  <th>Î¨∏Ìï≠ Î≤àÌò∏</th>
                  <th>ÏÉÅÌÉú</th>
                  <th>ÎÇúÏù¥ÎèÑ</th>
                  <th>ÏÑ∏Ìä∏ ID</th>
                  <th>ÏÉùÏÑ±Ïùº</th>
                  <th>ÏûëÏóÖ</th>
                </tr>
              </thead>
              <tbody>
                {requests.map(req => (
                  <tr key={req.request_id}>
                    <td style={{ fontFamily: 'monospace', fontSize: '0.85rem' }}>
                      {req.request_id?.slice(0, 8)}...
                    </td>
                    <td>RC{req.item_no}</td>
                    <td>{getStatusBadge(req.status)}</td>
                    <td>{req.level || '-'}</td>
                    <td>{req.set_id || '-'}</td>
                    <td className="text-muted" style={{ fontSize: '0.85rem' }}>
                      {new Date(req.created_at).toLocaleString('ko-KR')}
                    </td>
                    <td>
                      <div className="flex gap-2">
                        <button
                          className="btn btn-secondary btn-sm"
                          onClick={() => handleViewDetail(req.request_id)}
                        >
                          ÏÉÅÏÑ∏
                        </button>
                        {req.status === 'PENDING' && !req.set_id && (
                          <button
                            className="btn btn-primary btn-sm"
                            onClick={() => handleGenerate(req.request_id)}
                            disabled={generating[req.request_id]}
                          >
                            {generating[req.request_id] ? 'ÏÉùÏÑ± Ï§ë...' : 'ÏÉùÏÑ±'}
                          </button>
                        )}
                        <button
                          className="btn btn-danger btn-sm"
                          onClick={() => handleDelete(req.request_id)}
                        >
                          ÏÇ≠Ï†ú
                        </button>
                      </div>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}
      </div>

      {/* ÏÉÅÏÑ∏ Î™®Îã¨ */}
      {selectedItem && (
        <div className="modal-overlay" onClick={() => setSelectedItem(null)}>
          <div className="modal" onClick={e => e.stopPropagation()} style={{ maxWidth: '900px' }}>
            <div className="modal-header">
              <h3>Î¨∏Ìï≠ ÏÉÅÏÑ∏ Ï†ïÎ≥¥</h3>
              <button className="modal-close" onClick={() => setSelectedItem(null)}>√ó</button>
            </div>
            <div className="modal-body">
              <h4 className="mb-2">ÏöîÏ≤≠ Ï†ïÎ≥¥</h4>
              <div style={{ background: '#f5f5f5', padding: '12px', borderRadius: '4px', marginBottom: '16px' }}>
                <p><strong>ÏöîÏ≤≠ ID:</strong> {selectedItem.request?.request_id}</p>
                <p><strong>Î¨∏Ìï≠ Î≤àÌò∏:</strong> RC{selectedItem.request?.item_no}</p>
                <p><strong>ÏÉÅÌÉú:</strong> {selectedItem.request?.status}</p>
                <p><strong>ÎÇúÏù¥ÎèÑ:</strong> {selectedItem.request?.level || '-'}</p>
              </div>

              {selectedItem.request?.passage && (
                <>
                  <h4 className="mb-2">ÏßÄÎ¨∏</h4>
                  <div className="item-preview" style={{ marginBottom: '16px' }}>
                    <div className="passage">{selectedItem.request.passage}</div>
                  </div>
                </>
              )}

              {selectedItem.output && (
                <>
                  <h4 className="mb-2">ÏÉùÏÑ±Îêú Î¨∏Ìï≠</h4>
                  <div className="item-preview">
                    <div className="question">{selectedItem.output.question}</div>
                    <ol className="options">
                      {[1, 2, 3, 4, 5].map(i => (
                        <li
                          key={i}
                          className={selectedItem.output.answer === String(i) ? 'correct' : ''}
                        >
                          {i}. {selectedItem.output[`option_${i}`]}
                          {selectedItem.output.answer === String(i) && ' ‚úì'}
                        </li>
                      ))}
                    </ol>
                    {selectedItem.output.explanation && (
                      <div className="explanation">
                        <strong>Ìï¥ÏÑ§:</strong> {selectedItem.output.explanation}
                      </div>
                    )}
                  </div>
                </>
              )}

              {selectedItem.results?.length > 0 && (
                <>
                  <h4 className="mb-2 mt-4">Í≤ÄÏ¶ù Î°úÍ∑∏</h4>
                  <div className="json-viewer">
                    {selectedItem.results.map((r, i) => (
                      <div key={i}>
                        <strong>Í≤∞Í≥º {i + 1}:</strong> {r.validation_result}
                        <br />
                        <span>{r.validation_log}</span>
                        <hr style={{ borderColor: '#444', margin: '8px 0' }} />
                      </div>
                    ))}
                  </div>
                </>
              )}
            </div>
            <div className="modal-footer">
              <button className="btn btn-secondary" onClick={() => setSelectedItem(null)}>
                Îã´Í∏∞
              </button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}

export default ItemRequests;
